import React from "react";
import "../App.css";
import logo from "../components/askareappi.png";

const SettingsPage = () => {
  return (
    <div>
      <img
        src={logo}
        alt="logo"
        style={{ width: "20%", height: "11%", marginTop: "0" }}
      />
      <h1>Profile settings</h1>
    </div>
  );
};

export default SettingsPage;
